import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'Apple iPhone 15 Pro Max');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_input_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_input_filled.png'));

    // Click on the search button
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.click('.search-btn');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_button_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_button_clicked.png'));

    // Wait for the first product to appear and click on it
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.click('.product-card');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_first_product_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_first_product_clicked.png'));

    // Click on the add to cart button
    await page.waitForSelector('.add-to-cart', { timeout: 5000 });
    await page.click('.add-to-cart');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_added_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_added_to_cart.png'));

    return {
      success: true,
      action: "Added the first product to the cart",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
